  \"The occurrence of peregrine falcons (Falco peregrinus anatum) and other raptors
  on the Charley River, Alaska, 1981\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-06-17T01:56:30.759424\",\n\t\"name\": \"the-occurrence-of-peregrine-falcons-falco-peregrinus-anatum-and-other-raptors-on-the-charl\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of this field study
  was to assess the importance of the Charley River as nesting habitat for the endangered
  American Peregrine Falcon. Other objectives were to: locate and document the productivity
  of all nesting peregrines and band as many young as possible, locate the nests of
  other birds of prey and band young wherever possible, collect and identify prey
  remains from nest sites of all raptors, collect addled eggs, egg shell fragments,
  or dead birds if encountered, photograph cliffs and nest trees used by nesting raptors
  and plot the locations of all raptor observations on topographic maps.\",\n\t\"license_title\":
